import React from 'react';
import { ParallaxProvider, ParallaxBanner } from 'react-scroll-parallax';
import classes from './Parallax.module.css';

const parallax = props => {
    return(
        <ParallaxProvider>
            <ParallaxBanner
                className={classes.Parallax}
                layers={[
                    {
                        image: props.image,
                        amount: 0.7,
                        children: 'Hello'
                    }
                ]}
                style={{
                    height: '500px',
                }}
            >
                <h1>Hello</h1>
            </ParallaxBanner>
        </ParallaxProvider>
    )
}

export default parallax;
